t Order date or Activation date\n\nYou can create such dataset on a database level or using custom SQL in dataset like that:\n```sql\nSELECT \n\tt1.user_id,\n\tt1.order_platform, \n\ttoDate(date_trunc(''day'', t2.FirstDate)) as FirstOrderDate, \n\ttoDate(date_trunc(''day'', t1.order_creation_date)) as OrderDate\nFROM\n\tsamples.orders t1,\n\t(SELECT \n\t\tuser_id, \n\t\tMIN(order_creation_date) as FirstDate\n\tFROM samples.orders\n\tGROUP BY user_id) as t2\nWHERE t1.user_id =t2.user_id\n```\n\nThat will result data like on the right side."}, "type": "text", "namespace": "default"}, {"id": "EL4", "data": {"text": "Using `DATETRUNC([FirstOrderDate],''MONTH'')` calculate a First order month. Using  `floor(([OrderDate]-[FirstOrderDate])/30)` calculate amount of periods past from first order date. Using COUNTD([Client ID]) calculate number of clients in each cohort. Use this fileds configure a table like that:"}, "type": "text", "namespace": "default"}, {"id": "e1J", "data": {"text": "For accurate analysis it is better to use color coding by columns. That way we will be able to compare same \"age\" cohorts. In order to do so create a filed\n`[COUNTD(Client ID)]/MAX([COUNTD(Client ID)] among [FirstOrder_Month])` and drag it to color setion."}, "type": "text", "namespace": "default"}, {"id": "dlQ", "data": {"text": "To display retention, starting from the period \"1\" (to see what percentage of the original customers remained with active), use the calculated field:\n\n```sql\nif (\n[30d]=0,\nstr(round([COUNT([Client ID])),\nconcat(str(round(100*[Client ID]/RMAX([Client ID] among [30d]))), \"%\")\n)\n```\n\nFor color:\n\n```sql\nif (\n[30d]=0,\n(round([COUNTS])),\n(round(100*[COUNTS]/RMAX([COUNTS] among [30d])))\n)\n```"}, "type": "text", "namespace": "default"}, {"id": "3jP", "data": {"text": "># **Cohorts**"}, "type": "text", "namespace": "default"}, {"id": "v47", "data": {"size": "l", "text": "Data", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "a7L", "data": {"size": "l", "text": "Basic cohorts", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "Oj3", "data": {"size": "l", "text": "Retention and cohort size at one chart", "showInTOC": true}, "type": "title", "namespace": "default"}], "title": "Cohorts", "layout": [{"h": 19, "i": "bdQ", "w": 20, "x": 16, "y": 5}, {"h": 25, "i": "9Kn", "w": 24, "x": 0, "y": 30}, {"h": 18, "i": "1kE", "w": 24, "x": 0, "y": 59}, {"h": 27, "i": "W15", "w": 21, "x": 15, "y": 80}, {"h": 19, "i": "k76", "w": 16, "x": 0, "y": 5}, {"h": 3, "i": "EL4", "w": 22, "x": 0, "y": 27}, {"h": 4, "i": "e1J", "w": 24, "x": 0, "y": 55}, {"h": 17, "i": "dlQ", "w": 15, "x": 0, "y": 80}, {"h": 3, "i": "3jP", "w": 36, "x": 0, "y": 0}, {"h": 2, "i": "v47", "w": 36, "x": 0, "y": 3}, {"h": 3, "i": "a7L", "w": 36, "x": 0, "y": 24}, {"h": 3, "i": "Oj3", "w": 36, "x": 0, "y": 77}], "aliases": {}, "connections": []}], "counter": 720, "settings": {"expandTOC": false, "globalParams": {}, "silentLoading": false, "autoupdateInterval": null, "dependentSelectors": true, "maxConcurrentRequests": null}, "description": "This is an example dashboard for [DataLens](https://datalens.tech). You can find detailed feature descriptions on the tabs of the dashboard.", "schemeVersion": 7}', '{"is_release": true}', 'uid:systemId', '2023-09-21 16:42:04.230151+00', 'uid:systemId', '2023-09-21 16:42:04.230151+00', 1514651459633808403, 1507164768509628187, '{"05xu0bafozgep": "05xu0bafozgep", "05xu0cbm5lr6p": "05xu0cbm5lr6p", "05xu0e1so1o6p": "05xu0e1so1o6p", "05xu0fmnbe0up": "05xu0fmnbe0up", "16yxd7gojiacq": "16yxd7gojiacq", "27z4q4cl8umqr": "27z4q4cl8umqr", "27zw2cgw2r12r": "27zw2cgw2r12r", "27zw2cohp6war": "27zw2cohp6war", "27zw2cr72wyir": "27zw2cr72wyir", "27zw2f553fpqr": "27zw2f553fpqr", "27zw2jj0oekyr": "27zw2jj0oekyr", "27zw2juwp5emr": "27zw2juwp5emr", "491y4djzjzumt": "491y4djzjzumt", "491y4ewqzvbut": "491y4ewqzvbut", "491y4hy1jw5yt": "491y4hy1jw5yt", "491y4iy424wmt": "491y4iy424wmt", "6b306hs4db0iv": 