1}, {"h": 3, "i": "L0N", "w": 12, "x": 0, "y": 39}, {"h": 3, "i": "ZZ6", "w": 12, "x": 24, "y": 39}, {"h": 3, "i": "8kv", "w": 12, "x": 12, "y": 39}, {"h": 17, "i": "E1D", "w": 18, "x": 0, "y": 124}, {"h": 3, "i": "e64", "w": 36, "x": 0, "y": 121}, {"h": 20, "i": "74n", "w": 17, "x": 19, "y": 159}, {"h": 3, "i": "N91", "w": 17, "x": 19, "y": 156}, {"h": 15, "i": "AXP", "w": 12, "x": 0, "y": 5}, {"h": 16, "i": "350", "w": 12, "x": 0, "y": 23}, {"h": 14, "i": "Lrb", "w": 12, "x": 24, "y": 60}, {"h": 17, "i": "65e", "w": 18, "x": 18, "y": 124}, {"h": 14, "i": "dKE", "w": 12, "x": 0, "y": 77}, {"h": 3, "i": "G8N", "w": 12, "x": 0, "y": 74}, {"h": 3, "i": "7d4", "w": 36, "x": 0, "y": 91}, {"h": 18, "i": "AyO", "w": 18, "x": 0, "y": 94}, {"h": 18, "i": "3vW", "w": 18, "x": 18, "y": 94}], "aliases": {}, "connections": []}, {"id": "yB5", "items": [{"id": "DZJ", "data": {"tabs": [{"id": "zdb", "title": "Plan and Fact", "params": {}, "chartId": "27zw2jj0oekyr", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "B9L", "data": {"tabs": [{"id": "PpM", "title": "Three types of layers", "params": {}, "chartId": "27zw2cr72wyir", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "Y74", "data": {"tabs": [{"id": "bKZ", "title": "Avg by region", "params": {}, "chartId": "hmebhxanjbz86", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "r0z", "data": {"tabs": [{"id": "99g", "title": "Unstacked area chart", "params": {}, "chartId": "ejb8es4ih2ty3", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "1Xd", "data": {"text": "A combined chart is a chart that consists of layers. The page contains examples of the charts. \n\nCombo chart limitations:\n- The X-axis is common to all layers\n- Layers can be added, deleted, reordered, renamed\n- Each layer is executed in the database by a separate query\n- You can combine linear, columnar and area charts."}, "type": "text", "namespace": "default"}, {"id": "ng3", "data": {"text": "One of most frequent case is a comparison of a plan and a fact. The plan line can be shown as line, and factual data shown as bars."}, "type": "text", "namespace": "default"}, {"id": "WG4", "data": {"text": "You can combine several types of layers. In this example, there are three layers of different types:\n- Line chart\n- Column chart\n- Area chart"}, "type": "text", "namespace": "default"}, {"id": "5O6", "data": {"text": "In addition to the constants from the example above, you can output additional lines calculated through window or LOD functions.To calculate the average by category, a calculated field with the formula is used here:\n\n`avg(SUM([Sales] INCLUDE [Region]))`\n\nMore details about window functions can be found on the \"Window functions\" and \"Level of details functions\" tabs."}, "type": "text", "namespace": "default"}, {"id": "E8B", "data": {"text": "You can use a combined chart to display a area chart without stacking layers, hence all indicators are shown from 0 along the Y axis"}, "type": "text", "namespace": "default"}, {"id": "Y8Q", "data": {"text": "># **Combined chart**"}, "type": "text", "namespace": "default"}], "title": "Combined chart", "layout": [{"h": 12, "i": "DZJ", "w": 17, "x": 0, "y": 10}, {"h": 13, "i": "B9L", "w": 17, "x": 0, "y": 22}, {"h": 13, "i": "Y74", "w": 17, "x": 0, "y": 35}, {"h": 13, "i": "r0z", "w": 17, "x": 0, "y": 48}, {"h": 7, "i": "1Xd", "w": 19, "x": 0, "y": 3}, {"h": 12, "i": "ng3", "w": 19, "x": 17, "y": 10}, {"h": 13, "i": "WG4", "w": 19, "x": 17, "y": 22}, {"h": 13, "i": "5O6", "w": 19, "x": 17, "y": 48}, {"h": 13, "i": "E8B", "w": 19, "x": 17, "y": 61}, {"h": 3, "i": "Y8Q", "w": 36, "x": 0, "y": 0}], "aliases": {}, "connections": []}, {"id": "MNb", "items": [{"id": "yzR", "data": {"text": "Examples of using drill-down and tree features in DataLens"}, "type": "text", "namespace": "default"}, {"id": "Dj2", "data": {"tabs": [{"id": "znn", "title": "Title 1", "params": {}, "chartId": "mrjgmyu6wn56b", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "BjX", "data": {"tabs": [{"id": "PnJ", "title": "Title 1", "params": {}, "chartId": "mrjgm08df0peb", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "b10", "data": {"text": "The hierarchy can be created in charts. To create one, click on the \"+\" button on the top panel of the chart.\n\nAfter adding a hierarchy to the chart, you can interactively drill down on it. Example:\n**Product category 1  Product category 2    Product name**\n\nUsing \"bread crumbs\" you can return to the desired level or open the entire level."}, "type": "text", "namespace": "default"}, {"id": "AoP", "data": {"text": "You can add Hierarchy to different section, for example in color. "}, "type": "text", "namespace": "default"}, {"id": "BJD", "data": {"tabs": [{"id": "PJW", "title": "Title 1", "params": {}, "chartId": "sxpms78wdpaqh", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "V0K", "data": {"text": "You can add Hierarchy to different section, for example in X. "}, "type": "text", "namespace": "default"}, {"id": "AgL", "data": {"tabs": [{"id": "Nkz", "title": "Title 1", "params": {}, "chartId": "gldagp2ekyge5", "isDefault": true, "autoHeight": false, "description": ""}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "M4e", "data": {"text": "The tree is created using the TREE() function\n\n1. You need create an array describing the tree, with the full path for each node.\nThe sequence of values in the array determines the sequence of tree expansion.\n\nYou can use built-in function or create array at database.\n`TREE( ARRAY([Product category 1],[Product category 2],[Product category 3])`\n\n\n\n2. After the array is created based on it, you can create a tree using the formula: `TREE()''.\n\n\n##### Limitations of the current version\n- Only in flat tables\n- Without pagination\n- Without totals\n- Without remembering the state of disclosure\n- One tree/hierarchy per chart\n- No trees in selectors\n- Intermediate nodes of the tree must be stored in the source, even those for which there is no data"}, "type": "text", "namespace": "default"}, {"id": "kjW", "data": {"text": "># **Hierarchy**"}, "type": "text", "namespace": "default"}], "title": "Hierarchy", "layout": [{"h": 2, "i": "yzR", "w": 36, "x": 0, "y": 3}, {"h": 18, "i": "Dj2", "w": 17, "x": 0, "y": 5}, {"h": 13, "i": "BjX", "w": 17, "x": 0, "y": 40}, {"h": 18, "i": "b10", "w": 19, "x": 17, "y": 5}, {"h": 13, "i": "AoP", "w": 19, "x": 17, "y": 40}, {"h": 13, "i": "BJD", "w": 17, "x": 0, "y": 53}, {"h": 13, "i": "V0K", "w": 19, "x": 17, "y": 53}, {"h": 17, "i": "AgL", "w": 17, "x": 0, "y": 23}, {"h": 17, "i": "M4e", "w": 19, "x": 17, "y": 23}, {"h": 3, "i": "kjW", "w": 36, "x": 0, "y": 0}], "aliases": {}, "connections": []}, {"id": "3p5", "items": [{"id": "9kY", "data": {"size": "l", "text": "Header L", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "rdR", "data": {"size": "s", "text": "Header S", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "1ZA", "data": {"text": "# **Headers**\nHeaders are used to separate different sections of dashboards and for navigation in Content panel."}, "type": "text", "namespace": "default"}, {"id": "noj", "data": {"text": "**You can add Emojis to charts and dashboards:**\nRise and Fall         \nInfo and links      \nWarning        \nTrue/False  /   \nSearch  \nCompetitors and partners   \nChart type legend   \nText legend:    \n        \n        \n"}, "type": "text", "namespace": "default"}, {"id": "kJv", "data": {"size": "l", "text": "Emoji", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "eD4", "data": {"text": "You can add various types of objects to a dashboard and format them using formatting functions and markdown."}, "type": "text", "namespace": "default"}, {"id": "dYz", "data": {"text": "**Bold text**\n_Italic text_\n**_Italic Bold  text_**\n\n**Lists**\n* Point 1\n* Point 2\n* Point 3"}, "type": "text", "namespace": "default"}, {"id": "G7g", "data": {"tabs": [{"id": "d1Q", "title": "Title 1", "params": {}, "chartId": "05xu0fmnbe0up", "isDefault": true, "autoHeight": false, "description": "`if([Delivered, %]>0.65, CONCAT(\"\",STR(ROUND([Delivered, %]*100,1))),CONCAT(\"\",STR(round([Delivered, %]*100,1)))) + \"%\"`"}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "vLn", "data": {"size": "l", "text": "Links and formating functions", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "aJ1", "data": {"text": "You can use```URL()``` to create links to other applications or dashboards.\n ``URL(\"https://www.google.com/search$114q=\" + [Product name], [Product name])``  link to Google\nAlso you can format text by formating functions such as BOLD(), ITALIC() and MARKUP()"}, "type": "text", "namespace": "default"}, {"id": "JAv", "data": {"tabs": [{"id": "O2N", "title": "Click row to go to url", "params": {}, "chartId": "z4wtzhsv4vxko", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "L9R", "data": {"tabs": [{"id": "jOL", "title": "Title 1", "params": {}, "chartId": "ch96co0501xy1", "isDefault": true, "autoHeight": false, "description": "You can add custom labels with line brakes `if([Order month]=#2020-01-01#, ANY(\"Something<br>import<br>happened\"), NULL)`\n"}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "3ey", "data": {"text": "**Code**\n\n```kotlin\n    val a: Int = 1\n```\n\n#### **Foldable sections**\n{% cut \"Show text\" %}\n\nHidden text\n\n{% endcut %}"}, "type": "text", "namespace": "default"}, {"id": "Jv7", "data": {"text": "># **Formating**"}, "type": "text", "namespace": "default"}, {"id": "p42", "data": {"size": "m", "text": "Header M", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "jpB", "data": {"size": "xs", "text": "Header XS", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "ZbQ", "data": {"text": "# **Text objects**\nText objects allow you to create various types of content: text with formating, images. links, code, list, foldable sections and tables "}, "type": "text", "namespace": "default"}, {"id": "8Ez", "data": {"text": "**Tables**\n\n#|\n|| ** Status**  | **Condition**  ||\n|| Golden| more than 10 purchases||\n|| Silver | up to 10 purchases||\n|| Basic | 1 purchase per year||\n|#\n\n"}, "type": "text", "namespace": "default"}, {"id": "ljW", "data": {"text": "1. Point 1\n2. Point 2\n3. Point 3"}, "type": "text", "namespace": "default"}, {"id": "6N1", "data": {"text": ""}, "type": "text", "namespace": "default"}, {"id": "ozN", "data": {"text": "#\nYou can use emojis and utf symbols to create conditional formating. And you can use formating fields options in tables for color formating and bar charts."}, "type": "text", "namespace": "default"}, {"id": "XXa", "data": {"text": "                                                                                                                                                                                                                                                                            \n\n                                                                                    \n\n                                                  \n\n                                                                                                                                                                                                                                                        \n\n                                                                   