d": "voX", "data": {"size": "l", "text": "The same chart is filtered independently by different selectors ", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "5Y0", "data": {"text": "># **Selectors**"}, "type": "text", "namespace": "default"}], "title": "Selectors", "layout": [{"h": 15, "i": "J9l", "w": 22, "x": 0, "y": 7}, {"h": 15, "i": "jn0", "w": 11, "x": 0, "y": 26}, {"h": 15, "i": "ZG6", "w": 11, "x": 11, "y": 26}, {"h": 2, "i": "84v", "w": 11, "x": 0, "y": 24}, {"h": 2, "i": "4Z8", "w": 11, "x": 11, "y": 24}, {"h": 2, "i": "l6A", "w": 36, "x": 0, "y": 3}, {"h": 2, "i": "6dy", "w": 6, "x": 0, "y": 5}, {"h": 2, "i": "QKY", "w": 30, "x": 6, "y": 5}, {"h": 17, "i": "ojl", "w": 14, "x": 22, "y": 24}, {"h": 15, "i": "XMZ", "w": 14, "x": 22, "y": 7}, {"h": 2, "i": "voX", "w": 36, "x": 0, "y": 22}, {"h": 3, "i": "5Y0", "w": 36, "x": 0, "y": 0}], "aliases": {"default": [["0483c778-3a9a-4f65-8168-1beb8818580f", "45bdfbb6-1dd9-41bd-9871-b011efd8ec6b"]]}, "connections": [{"to": "84v", "from": "Obz", "kind": "ignore"}, {"to": "Obz", "from": "84v", "kind": "ignore"}, {"to": "4Z8", "from": "Obz", "kind": "ignore"}, {"to": "Obz", "from": "4Z8", "kind": "ignore"}, {"to": "4Z8", "from": "p6R", "kind": "ignore"}, {"to": "p6R", "from": "4Z8", "kind": "ignore"}, {"to": "84v", "from": "LbN", "kind": "ignore"}, {"to": "LbN", "from": "84v", "kind": "ignore"}, {"to": "4Z8", "from": "84v", "kind": "ignore"}, {"to": "84v", "from": "4Z8", "kind": "ignore"}]}, {"id": "PoW", "items": [{"id": "bdQ", "data": {"tabs": [{"id": "Ral", "title": "Data", "params": {}, "chartId": "491y4hy1jw5yt", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "9Kn", "data": {"tabs": [{"id": "Y1g", "title": "Title 1", "params": {}, "chartId": "sxpmsao0sscqh", "isDefault": true, "autoHeight": true}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "1kE", "data": {"tabs": [{"id": "roE", "title": "Title 1", "params": {}, "chartId": "fkc9fu79zvxg4", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "W15", "data": {"tabs": [{"id": "nde", "title": "Title 1", "params": {}, "chartId": "27zw2juwp5emr", "isDefault": true, "autoHeight": true}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "k76", "data": {"text": "Cohorts analysis is a common analysis type in product analytics. You can create this type of analysis in DataLens. We need to get a dataset with three fields:\n Client ID\n Order date\n First Order date or Activation date\n\nYou can create such dataset on a database level or using custom SQL in dataset like that:\n```sql\nSELECT \n\tt1.user_id,\n\tt1.order_platform, \n\ttoDate(date_trunc(''day'', t2.FirstDate)) as FirstOrderDate, \n\ttoDate(date_trunc(''day'', t1.order_creation_date)) as OrderDate\nFROM\n\tsamples.orders t1,\n\t(SELECT \n\t\tuser_id, \n\t\tMIN(order_creation_date) as FirstDate\n\tFROM samples.orders\n\tGROUP BY user_id) as t2\nWHERE t1.user_id =t2.user_id\n```\n\nThat will result data like on the right side."}, "type": "text", "namespace": "default"}, {"id": "EL4", "data": {"text": "Using `DATETRUNC([FirstOrderDate],''MONTH'')` calculate a First order month. Using  `floor(([OrderDate]-[FirstOrderDate])/30)` calculate amount of periods past from first order date. Using COUNTD([Client ID]) calculate number of clients in each cohort. Use this fileds configure a table like that:"}, "type": "text", "namespace": "default"}, {"id": "e1J", "data": {"text": "For accurate analysis it is better to use color coding by columns. That way we will be able to compare same \"age\" cohorts. In order to do so create a filed\n`[COUNTD(Client ID)]/MAX([COUNTD(Client ID)] among [FirstOrder_Month])` and drag it to color setion."}, "type": "text", "namespace": "default"}, {"id": "dlQ", "data": {"text": "To display retention, starting from the period \"1\" (to see what percentage of the original customers remained with active), use the calculated field:\n\n```sql\nif (\n[30d]=0,\nstr(round([COUNT([Client ID])),\nconcat(str(round(100*[Client ID]/RMAX([Client ID] among [30d]))), \"%\")\n)\n```\n\nFor color:\n\n```sql\nif (\n[30d]=0,\n(round([COUNTS])),\n(round(100*[COUNTS]/RMAX([COUNTS] among [30d])))\n)\n```"}, "type": "text", "namespace": "default"}, {"id": "3jP", "data": {"text": "># **Cohorts**"}, "type": "text", "namespace": "default"}, {"id": "v47", "data": {"size": "l", "text": "Data", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "a7L", "data": {"size": "l", "text": "Basic cohorts", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "Oj3", "data": {"size": "l", "text": "Retention and cohort size at one chart", "showInTOC": true}, "type": "title", "namespace": "default"}], "title": "Cohorts", "layout": [{"h": 19, "i": "bdQ", "w": 20, "x": 16, "y": 5}, {"h": 25, "i": "9Kn", "w": 24, "x": 0, "y": 30}, {"h": 18, "i": "1kE", "w": 24, "x": 0, "y": 59}, {"h": 27, "i": "W15", "w": 21, "x": 15, "y": 80}, {"h": 19, "i": "k76", "w": 16, "x": 0, "y": 5}, {"h": 3, "i": "EL4", "w": 22, "x": 0, "y": 27}, {"h": 4, "i": "e1J", "w": 24, "x": 0, "y": 55}, {"h": 17, "i": "dlQ", "w": 15, "x": 0, "y": 80}, {"h": 3, "i": "3jP", "w": 36, "x": 0, "y": 0}, {"h": 2, "i": "v47", "w": 36, "x": 0, "y": 3}, {"h": 3, "i": "a7L", "w": 36, "x": 0, "y": 24}, {"h": 3, "i": "Oj3", "w": 36, "x": 0, "y": 77}], "aliases": {}, "connections": []}], "counter": 720, "settings": {"expandTOC": false, "globalParams": {}, "silentLoading": false, "autoupdateInterval": null, "dependentSelectors": true, "maxConcurrentRequests": null}, "description": "This is an example dashboard for [DataLens](https://datalens.tech). You can find detailed feature descriptions on the tabs of the dashboard.", "schemeVersion": 7}', '{"is_release": true}', 'uid:systemId', '2023-11-24 13:44:43.626344+00', 'uid:systemId', '2023-11-24 13:44:43.626344+00', 1560947846314722315, 1507164