eight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "grL", "data": {"text": "Calculated field `AVG(COUNT([client ID] INCLUDE [Application date]))` allows you to perform double aggregation: first we count the number of unique buyers by day, then we count the average of them across a month. In this example, the average is calculated by month (see chart measurement). Thus, we got the \"average clients per day\"."}, "type": "text", "namespace": "default"}, {"id": "PGJ", "data": {"text": "Examples of using Level of Detail (LOD) or double aggregation functions in calculated fields. In some cases, LODs are similar to regular window functions. An important difference between LOD functions is the support of the `COUNTD` function."}, "type": "text", "namespace": "default"}, {"id": "Wod", "data": {"text": "># **Level of Details functions**"}, "type": "text", "namespace": "default"}], "title": "Level of detail functions", "layout": [{"h": 16, "i": "lGA", "w": 19, "x": 0, "y": 10}, {"h": 2, "i": "64y", "w": 36, "x": 0, "y": 8}, {"h": 16, "i": "QLY", "w": 17, "x": 19, "y": 10}, {"h": 2, "i": "o6l", "w": 36, "x": 0, "y": 26}, {"h": 16, "i": "0a8", "w": 19, "x": 0, "y": 28}, {"h": 16, "i": "grL", "w": 17, "x": 19, "y": 28}, {"h": 5, "i": "PGJ", "w": 20, "x": 0, "y": 3}, {"h": 3, "i": "Wod", "w": 36, "x": 0, "y": 0}], "aliases": {}, "connections": []}, {"id": "71g", "items": [{"id": "J9l", "data": {"tabs": [{"id": "Obz", "title": "This chart is linked only to the selecot above", "params": {}, "chartId": "y3vsya0uiqbqn", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "jn0", "data": {"tabs": [{"id": "p6R", "title": "Title 1", "params": {}, "chartId": "y3vsya0uiqbqn", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "ZG6", "data": {"tabs": [{"id": "LbN", "title": "Title 1", "params": {}, "chartId": "y3vsya0uiqbqn", "isDefaul