, "kind": "ignore"}, {"to": "8Rb", "from": "dNE", "kind": "ignore"}, {"to": "dNE", "from": "8Rb", "kind": "ignore"}, {"to": "D1J", "from": "dNE", "kind": "ignore"}, {"to": "dNE", "from": "D1J", "kind": "ignore"}, {"to": "WE4", "from": "dNE", "kind": "ignore"}, {"to": "dNE", "from": "WE4", "kind": "ignore"}, {"to": "NlO", "from": "dNE", "kind": "ignore"}, {"to": "dNE", "from": "NlO", "kind": "ignore"}, {"to": "8Rb", "from": "Mrv", "kind": "ignore"}, {"to": "Mrv", "from": "8Rb", "kind": "ignore"}, {"to": "D1J", "from": "Mrv", "kind": "ignore"}, {"to": "Mrv", "from": "D1J", "kind": "ignore"}, {"to": "YP4", "from": "Mrv", "kind": "ignore"}, {"to": "Mrv", "from": "YP4", "kind": "ignore"}, {"to": "WE4", "from": "Mrv", "kind": "ignore"}, {"to": "Mrv", "from": "WE4", "kind": "ignore"}, {"to": "WE4", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "WE4", "kind": "ignore"}, {"to": "8Rb", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "8Rb", "kind": "ignore"}, {"to": "D1J", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "D1J", "kind": "ignore"}, {"to": "lP4", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "lP4", "kind": "ignore"}, {"to": "BXL", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "BXL", "kind": "ignore"}, {"to": "RRK", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "RRK", "kind": "ignore"}, {"to": "YP4", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "YP4", "kind": "ignore"}, {"to": "rrz", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "rrz", "kind": "ignore"}, {"to": "5E6", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "5E6", "kind": "ignore"}, {"to": "eAZ", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "eAZ", "kind": "ignore"}, {"to": "dNE", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "dNE", "kind": "ignore"}, {"to": "G5N", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "G5N", "kind": "ignore"}, {"to": "Mrv", "from": "1Jl", "kind": "ignore"}, {"to": "1Jl", "from": "Mrv", "kind": "ignore"}]}, {"id": "GD4", "items": [{"id": "lNP", "data": {"tabs": [{"id": "4kz", "title": "DATETRUNC([Date], \"week\")", "params": {}, "chartId": "dia7dulbcwxc2", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "Qnj", "data": {"tabs": [{"id": "6k5", "title": "DATEPART([Date], \"hour\")", "params": {}, "chartId": "bg85bre1z5ik0", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "z2A", "data": {"tabs": [{"id": "yQ3", "title": "Title 1", "params": {}, "chartId": "ch96cr73sjd21", "isDefault": true, "autoHeight": false, "description": "You can add miniature date navigator for line charts in settings of the line chart"}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "6B5", "data": {"title": "Order date", "source": {"isRange": true, "datasetId": "qvnkqz8s0wdqf", "showTitle": true, "elementType": "date", "defaultValue": "__interval___relative_-7y___relative_-0d", "datasetFieldId": "3dcc4a70-e1f0-11e9-a279-0b30c0a74ab7"}, "sourceType": "dataset"}, "type": "control", "defaults": {"3dcc4a70-e1f0-11e9-a279-0b30c0a74ab7": "__interval___relative_-7y___relative_-0d"}, "namespace": "default"}, {"id": "oZJ", "data": {"text": "In order to work with dates its important to set data type of fileds to date at datasource. If format you are using is not recognized automatically you can convert the data type using the functions: DATETIME(), DATE(), DATETIME_PARSE(), DATE_PARSE()."}, "type": "text", "namespace": "default"}, {"id": "XEj", "data": {"text": "Date type fields support calendars as selectors and flexible automatic relative dates selections like: last year, last 7 days, last and next 3 months and so on. "}, "type": "text", "namespace": "default"}, {"id": "gev", "data": {"text": "You can group dates in the interface click to left side of field or using functions like DATETRUNC() or DATEPART().\n\n`DATETRUNC([OrderDate], \"WEEK\")`  will truncate date up to weeks\n`DATEPART([OrderDate], \"hour\")`  will return names of hours"}, "type": "text", "namespace": "default"}, {"id": "jPL", "data": {"tabs": [{"id": "p15", "title": "Title 1", "params": {}, "chartId": "ejb8ep80pi163", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "L3R", "data": {"text": "**Rows**:\nMonth - `DATETRUNC([Order date], \"month\")`\nWeek number - `if( week([Order date])>51 and MONTH([Order date])=1, 0, week([Order date]))`  -- if statement to get right result at the end of a year\n\n**Columns**:\nDay oof Week - `CASE(DAYOFWEEK([Order date]),1,\"1-Mn\",2,\"2-Tu\",3,\"3-We\",4,\"4-Th\",5,\"5-Fr\",6,\"6-St\",7,\"7-Sn\",\"NA\")`\n\n**Cell**:\nDay - `max(DAY([Order date]))` -- Max is needed to convert it to Measure\n\n**Color**:\n`Sales - SUM([amount])` -- Metric for heatmap"}, "type": "text", "namespace": "default"}, {"id": "e3E", "data": {"size": "m", "text": "Month over Month and AGO()", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "GAX", "data": {"tabs": [{"id": "dMV", "title": "Title 1", "params": {}, "chartId": "27zw2f553fpqr", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "Ka4", "data": {"text": "Add calculated field `AGO([Sales], [Date Month], ''month'', 1)`. \\[Documentation link\\](https://cloud.yandex.ru/docs/datalens/function-ref/AGO\n\nTo calculate MoM,% create a calculated field `([Sales] - [Ago 1 Month Sales]) / ABS([Ago 1 Month Sales])`\n\nAlso you can use functions LAG() or AT_DATE() for different cases. For example `AT_DATE([Sales],[Date], DATETRUNC([Date],''week''))` will give you Sales at the first date of the week."}, "type": "text", "namespace": "default"}, {"id": "7Ea", "data": {"text": "># **Date functions**"}, "type": "text", "namespace": "default"}, {"id": "Npo", "data": {"size": "m", "text": "Heatmap calendar", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "AY0", "data": {"size": "l", "text": "DATETRUNC() and DATEPART()", "showInTOC": true}, "type": "title", "namespace": "default"}], "title": "Date functions", "layout": [{"h": 9, "i": "lNP", "w": 8, "x": 20, "y": 14}, {"h": 9, "i": "Qnj", "w": 8, "x": 28, "y": 14}, {"h": 14, "i": "z2A", "w": 20, "x": 0, "y": 9}, {"h": 3, "i": "6B5", "w": 7, "x": 29, "y": 3}, {"h": 3, "i": "oZJ", "w": 17, "x": 0, "y": 3}, {"h": 3, "i": "XEj", "w": 12, "x": 17, "y": 3}, {"h": 5, "i": "gev", "w": 16, "x": 20, "y": 9}, {"h": 16, "i": "jPL", "w": 17, "x": 0, "y": 46}, {"h": 16, "i": "L3R", "w": 19, "x": 17, "y": 46}, {"h": 3, "i": "e3E", "w": 36, "x": 0, "y": 23}, {"h": 17, "i": "GAX", "w": 17, "x": 0, "y": 26}, {"h": 17, "i": "Ka4", "w": 19, "x": 17, "y": 26}, {"h": 3, "i": "7Ea", "w": 36, "x": 0, "y": 0}, {"h": 3, "i": "Npo", "w": 36, "x": 0, "y": 43}, {"h": 3, "i": "AY0", "w": 36, "x": 0, "y": 6}], "aliases": {}, "connections": [{"to": "p15", "from": "6B5", "kind": "ignore"}, {"to": "6B5", "from": "p15", "kind": "ignore"}]}, {"id": "Are", "items": [{"id": "evd", "data": {"tabs": [{"id": "EB3", "title": "Title 1", "params": {}, "chartId": "sxpms3pgygm6h", "isDefault": true, "autoHeight": true}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "GBp", "data": {"tabs": [{"id": "dWP", "title": "Title 1", "params": {}, "chartId": "af74aq6s79dez", "isDefault": true, "autoHeight": true}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "7gg", "data": {"tabs": [{"id": "KQn", "title": "Title 1", "params": {}, "chartId": "tyqnt5kbstbsi", "isDefault": true, "autoHeight": true}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "AMe", "data": {"tabs": [{"id": "d6z", "title": "Title 1", "params": {}, "chartId": "ch96cl4boozy1", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "3g5", "data": {"tabs": [{"id": "MXb", "title": "Title 1", "params": {}, "chartId": "8d528nx6xy7ix", "isDefault": true, "autoHeight": true}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "aYl", "data": {"tabs": [{"id": "OOe", "title": "Title 1", "params": {}, "chartId": "gldagrksddhm5", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "OO2", "data": {"size": "l", "text": "Top 5", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "J5Z", "data": {"size": "l", "text": "Top 3 for each category", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "pDn", "data": {"size": "m", "text": "Percent of total", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "GB1", "data": {"size": "l", "text": "Percent of total by years and regions", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "KQY", "data": {"size": "m", "text": "Running sum", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "7gE", "data": {"size": "l", "text": "Moving average", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "NRY", "data": {"text": "To filter top 5 create calculated filed with `rank([Sales])` function and drug this filed to Filter section.\n\nYou can find additional info about `RANK` in documentation."}, "type": "text", "namespace": "default"}, {"id": "AMA", "data": {"text": "Add calculated field `rank([Sales] WITHIN [Category])` and drag it to Filter section,\n\nYou can find additional info about `RANK` in documentation."}, "type": "text", "namespace": "default"}, {"id": "MX1", "data": {"text": "Add calculated filed `[Sales] / sum([Sales] Total) `.\n\nYou can find additional info about  `SUM` in documentation."}, "type": "text", "namespace": "default"}, {"id": "3gr", "data": {"text": "Add calculated filed `[Sales] / sum([Sales] WITHIN [Year])`.\n\nYou can find additional info about `SUM` in documentation."}, "type": "text", "namespace": "default"}, {"id": "v26", "data": {"text": "Add calculated filed  `RSUM([Sales])`.\n\nUsing `RSUM()` requires sort by dimension in Sort section.\n\nYou can find additional info about `RSUM` in documentation."}, "type": "text", "namespace": "default"}, {"id": "aYX", "data": {"text": "Add calculated filed `avg([Sales], 5)`, `mavg([Sales], 5,5)`.\n\nThe moving average allows to smooth outliers in data, for example, in sensor readings. Using `MAVG()` requires sort by dimension in Sort section.\n\nYou can find additional info about `MAVG` in documentation."}, "type": "text", "namespace": "default"}, {"id": "J5E", "data": {"size": "l", "text": "Calculating window function before filtering (Before Filter By feature)", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "j2N", "data": {"tabs": [{"id": "pDK", "title": "Title 1", "params": {}, "chartId": "otlio4n8g6zed", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "LnJ", "data": {"size": "l", "text": "Show only top 3 categories (nested window calcualtions)", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "8WP", "data": {"tabs": [{"id": "ZvB", "title": "Title 1", "params": {}, "chartId": "ejb8eut7kkr63", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "4j7", "data": {"text": "In order to get top 3 lines by sales create calculated field `RANK_DENSE(sum([Sales] within [Product category 1]))` and drag it to the filter.\n\nIn this formula, we first count the sum of all points inside the value `[Product category 1]`, then count `RANK_DENSE()`\n\nYou can make window functions nested in each other (in this case, `SUM` and \\`RANK_DENSE''). More complex combinations are also possible.\n\nYou can find additional info about `RANK_DENSE` function in documentation."}, "type": "text", "namespace": "default"}, {"id": "lZk", "data": {"text": "We want to filter several dimension, but calculate percent of total to the values from all dimension without filtering.\n\nAdd calculated filed\n`[Sales] / sum([Sales] within [Order year] before filter by [category_name_level_1])`\nallows you to calculate the percent of each category for the year.\n\nUsing ''before filtering by'' makes filtering by dimension ''\\[category_name_level_1\\]'' occurs after calculating the window function.\n\nFind out details about ''BEFORE FILTER BY'' in documentation."}, "type": "text", "namespace": "default"}, {"id": "n7p", "data": {"text": "Calculated fields are created at the dataset level or at the chart level (will be available only for this chart). In the examples, calculated fields are created at the chart level. You can edit them quickly and immediately see the result on the visualization.\n\nFor a general description of window functions, see documentation."}, "type": "text", "namespace": "default"}, {"id": "Gl4", "data": {"size": "l", "text": "Label only last value", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "7pn", "data": {"tabs": [{"id": "KbO", "title": "Title 1", "params": {}, "chartId": "w1tqwdaymiv2l", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "Nr1", "data": {"text": "Add calculated filed\n\n```sql\nif(\n    max([Order month]) = LAST(max([Order month])), --check if point is the last\n    [Sales], --if yes, show metric\n    null --if no, show nothing\n)\n```\n\nAdd it to Labels section.\n\nYou can find additional info about `MAX` in documentation."}, "type": "text", "namespace": "default"}, {"id": "9YE", "data": {"text": "># **Window functions**"}, "type": "text", "namespace": "default"}], "title": "Window functions", "layout": [{"h": 10, "i": "evd", "w": 16, "x": 0, "y": 9}, {"h": 12, "i": "GBp", "w": 16, "x": 0, "y": 20}, {"h": 12, "i": "7gg", "w": 16, "x": 0, "y": 37}, {"h": 15, "i": "AMe", "w": 16, "x": 0, "y": 48}, {"h": 12, "i": "3g5", "w": 16, "x": 0, "y": 65}, {"h": 16, "i": "aYl", "w": 16, "x": 0, "y": 83}, {"h": 2, "i": "OO2", "w": 36, "x": 0, "y": 7}, {"h": 2, "i": "J5Z", "w": 36, "x": 0, "y": 18}, {"h": 2, "i": "pDn", "w": 36, "x": 0, "y": 35}, {"h": 2, "i": "GB1", "w": 36, "x": 0, "y": 46}, {"h": 2, "i": "KQY", "w": 36, "x": 0, "y": 63}, {"h": 2, "i": "7gE", "w": 36, "x": 0, "y": 81}, {"h": 3, "i": "NRY", "w": 20, "x": 16, "y": 9}, {"h": 4, "i": "AMA", "w": 20, "x": 16, "y": 20}, {"h": 4, "i": "MX1", "w": 20, "x": 16, "y": 37}, {"h": 6, "i": "3gr", "w": 20, "x": 16, "y": 48}, {"h": 4, "i": "v26", "w": 20, "x": 16, "y": 65}, {"h": 7, "i": "aYX", "w": 20, "x": 16, "y": 83}, {"h": 2, "i": "J5E", "w": 36, "x": 0, "y": 144}, {"h": 14, "i": "j2N", "w": 16, "x": 0, "y": 101}, {"h": 2, "i": "LnJ", "w": 36, "x": 0, "y": 99}, {"h": 21, "i": "8WP", "w": 9, "x": 0, "y": 146}, {"h": 14, "i": "4j7", "w": 20, "x": 16, "y": 101}, {"h": 21, "i": "lZk", "w": 27, "x": 9, "y": 146}, {"h": 4, "i": "n7p", "w": 36, "x": 0, "y": 3}, {"h": 2, "i": "Gl4", "w": 36, "x": 0, "y": 115}, {"h": 15, "i": "7pn", "w": 16, "x": 0, "y": 117}, {"h": 15, "i": "Nr1", "w": 20, "x": 16, "y": 117}, {"h": 3, "i": "9YE", "w": 36, "x": 0, "y": 0}], "aliases": {}, "connections": []}, {"id": "457", "items": [{"id": "lGA", "data": {"tabs": [{"id": "4Q8", "title": "FIXED", "params": {}, "chartId": "qvnkq5oj2gy2f", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "64y", "data": {"size": "l", "text": "Percent of total for COUNTD()", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "QLY", "data": {"text": "Create a calculated field `COUNTD([Client ID]) / COUNTD([Client ID] FIXED)`."}, "type": "text", "namespace": "default"}, {"id": "o6l", "data": {"size": "l", "text": "Double aggregation", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "0a8", "data": {"tabs": [{"id": "XaZ", "title": "INCLUDE", "params": {}, "chartId": "rwolr3bej5gwg", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "grL", "data": {"text": "Calculated field `AVG(COUNT([client ID] INCLUDE [Application date]))` allows you to perform double aggregation: first we count the number of unique buyers by day, then we count the average of them across a month. In this example, the average is calculated by month (see chart measurement). Thus, we got the \"average clients per day\"."}, "type": "text", "namespace": "default"}, {"id": "PGJ", "data": {"text": "Examples of using Level of Detail (LOD) or double aggregation functions in calculated fields. In some cases, LODs are similar to regular window functions. An important difference between LOD functions is the support of the `COUNTD` function."}, "type": "text", "namespace": "default"}, {"id": "Wod", "data": {"text": "># **Level of Details functions**"}, "type": "text", "namespace": "default"}], "title": "Level of detail functions", "layout": [{"h": 16, "i": "lGA", "w": 19, "x": 0, "y": 10}, {"h": 2, "i": "64y", "w": 36, "x": 0, "y": 8}, {"h": 16, "i": "QLY", "w": 17, "x": 19, "y": 10}, {"h": 2, "i": "o6l", "w": 36, "x": 0, "y": 26}, {"h": 16, "i": "0a8", "w": 19, "x": 0, "y": 28}, {"h": 16, "i": "grL", "w": 17, "x": 19, "y": 28}, {"h": 5, "i": "PGJ", "w": 20, "x": 0, "y": 3}, {"h": 3, "i": "Wod", "w": 36, "x": 0, "y": 0}], "aliases": {}, "connections": []}, {"id": "71g", "items": [{"id": "J9l", "data": {"tabs": [{"id": "Obz", "title": "This chart is linked only to the selecot above", "params": {}, "chartId": "y3vsya0uiqbqn", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "jn0", "data": {"tabs": [{"id": "p6R", "title": "Title 1", "params": {}, "chartId": "y3vsya0uiqbqn", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "ZG6", "data": {"tabs": [{"id": "LbN", "title": "Title 1", "params": {}, "chartId": "y3vsya0uiqbqn", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "84v", "data": {"title": "Main category", "source": {"datasetId": "qvnkqz8s0wdqf", "fieldType": "string", "showTitle": true, "elementType": "select", "datasetFieldId": "45bdfbb6-1dd9-41bd-9871-b011efd8ec6b", "multiselectable": true, "datasetFieldType": "DIMENSION"}, "sourceType": "dataset"}, "type": "control", "defaults": {"45bdfbb6-1dd9-41bd-9871-b011efd8ec6b": ""}, "namespace": "default"}, {"id": "4Z8", "data": {"title": "Category to compare", "source": {"datasetId": "qvnkqz8s0wdqf", "fieldType": "string", "showTitle": true, "elementType": "select", "datasetFieldId": "45bdfbb6-1dd9-41bd-9871-b011efd8ec6b", "multiselectable": true, "datasetFieldType": "DIMENSION"}, "sourceType": "dataset"}, "type": "control", "defaults": {"45bdfbb6-1dd9-41bd-9871-b011efd8ec6b": ""}, "namespace": "default"}, {"id": "l6A", "data": {"text": "The page provides an example of setting up links between selectors and charts. To change the settings in the dashboard editing mode, click on the \"links\" button on the top panel. This page uses only one chart added multiple times."}, "type": "text", "namespace": "default"}, {"id": "6dy", "data": {"title": "Year", "source": {"datasetId": "qvnkqz8s0wdqf", "showTitle": true, "elementType": "select", "datasetFieldId": "9cd1cbd0-0ee4-11ec-b9e8-6b5e199aa6f2", "multiselectable": true}, "sourceType": "dataset"}, "type": "control", "defaults": {"9cd1cbd0-0ee4-11ec-b9e8-6b5e199aa6f2": ""}, "namespace": "default"}, {"id": "QKY", "data": {"text": "This is the selector that linked to all charts at the tab."}, "type": "text", "namespace": "default"}, {"id": "ojl", "data": {"text": "You can create comparison panels using that approach. "}, "type": "text", "namespace": "default"}, {"id": "XMZ", "data": {"text": " "}, "type": "text", "namespace": "default"}, {"id": "voX", "data": {"size": "l", "text": "The same chart is filtered independently by different selectors ", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "5Y0", "data": {"text": "># **Selectors**"}, "type": "text", "namespace": "default"}], "title": "Selectors", "layout": [{"h": 15, "i": "J9l", "w": 22, "x": 0, "y": 7}, {"h": 15, "i": "jn0", "w": 11, "x": 0, "y": 26}, {"h": 15, "i": "ZG6", "w": 11, "x": 11, "y": 26}, {"h": 2, "i": "84v", "w": 11, "x": 0, "y": 24}, {"h": 2, "i": "4Z8", "w": 11, "x": 11, "y": 24}, {"h": 2, "i": "l6A", "w": 36, "x": 0, "y": 3}, {"h": 2, "i": "6dy", "w": 6, "x": 0, "y": 5}, {"h": 2, "i": "QKY", "w": 30, "x": 6, "y": 5}, {"h": 17, "i": "ojl", "w": 14, "x": 22, "y": 24}, {"h": 15, "i": "XMZ", "w": 14, "x": 22, "y": 7}, {"h": 2, "i": "voX", "w": 36, "x": 0, "y": 22}, {"h": 3, "i": "5Y0", "w": 36, "x": 0, "y": 0}], "aliases": {"default": [["0483c778-3a9a-4f65-8168-1beb8818580f", "45bdfbb6-1dd9-41bd-9871-b011efd8ec6b"]]}, "connections": [{"to": "84v", "from": "Obz", "kind": "ignore"}, {"to": "Obz", "from": "84v", "kind": "ignore"}, {"to": "4Z8", "from": "Obz", "kind": "ignore"}, {"to": "Obz", "from": "4Z8", "kind": "ignore"}, {"to": "4Z8", "from": "p6R", "kind": "ignore"}, {"to": "p6R", "from": "4Z8", "kind": "ignore"}, {"to": "84v", "from": "LbN", "kind": "ignore"}, {"to": "LbN", "from": "84v", "kind": "ignore"}, {"to": "4Z8", "from": "84v", "kind": "ignore"}, {"to": "84v", "from": "4Z8", "kind": "ignore"}]}, {"id": "PoW", "items": [{"id": "bdQ", "data": {"tabs": [{"id": "Ral", "title": "Data", "params": {}, "chartId": "491y4hy1jw5yt", "isDefault": true, "autoHeight": false}], "hideTitle": false}, "type": "widget", "namespace": "default"}, {"id": "9Kn", "data": {"tabs": [{"id": "Y1g", "title": "Title 1", "params": {}, "chartId": "sxpmsao0sscqh", "isDefault": true, "autoHeight": true}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "1kE", "data": {"tabs": [{"id": "roE", "title": "Title 1", "params": {}, "chartId": "fkc9fu79zvxg4", "isDefault": true, "autoHeight": false}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "W15", "data": {"tabs": [{"id": "nde", "title": "Title 1", "params": {}, "chartId": "27zw2juwp5emr", "isDefault": true, "autoHeight": true}], "hideTitle": true}, "type": "widget", "namespace": "default"}, {"id": "k76", "data": {"text": "Cohorts analysis is a common analysis type in product analytics. You can create this type of analysis in DataLens. We need to get a dataset with three fields:\n Client ID\n Order date\n First Order date or Activation date\n\nYou can create such dataset on a database level or using custom SQL in dataset like that:\n```sql\nSELECT\n\t t1.user_id,\n\t t1.order_platform,\n\t date_trunc(''day'', t2.FirstDate) as \"FirstOrderDate\",\n\t date_trunc(''day'', t1.order_creation_date) as \"OrderDate\"\nFROM\n\t public.orders as t1,\n\t (SELECT\n\t\t  user_id,\n\t\t  MIN(order_creation_date) as FirstDate\n\t FROM public.orders\n\t GROUP BY user_id) as t2\nWHERE t1.user_id = t2.user_id\n```\n\nThat will result data like on the right side."}, "type": "text", "namespace": "default"}, {"id": "EL4", "data": {"text": "Using `DATETRUNC([FirstOrderDate],''MONTH'')` calculate a First order month. Using  `floor(([OrderDate]-[FirstOrderDate])/30)` calculate amount of periods past from first order date. Using COUNTD([Client ID]) calculate number of clients in each cohort. Use this fileds configure a table like that:"}, "type": "text", "namespace": "default"}, {"id": "e1J", "data": {"text": "For accurate analysis it is better to use color coding by columns. That way we will be able to compare same \"age\" cohorts. In order to do so create a filed\n`[COUNTD(Client ID)]/MAX([COUNTD(Client ID)] among [FirstOrder_Month])` and drag it to color setion."}, "type": "text", "namespace": "default"}, {"id": "dlQ", "data": {"text": "To display retention, starting from the period \"1\" (to see what percentage of the original customers remained with active), use the calculated field:\n\n```sql\nif (\n[30d]=0,\nstr(round([COUNT([Client ID])),\nconcat(str(round(100*[Client ID]/RMAX([Client ID] among [30d]))), \"%\")\n)\n```\n\nFor color:\n\n```sql\nif (\n[30d]=0,\n(round([COUNTS])),\n(round(100*[COUNTS]/RMAX([COUNTS] among [30d])))\n)\n```"}, "type": "text", "namespace": "default"}, {"id": "3jP", "data": {"text": "># **Cohorts**"}, "type": "text", "namespace": "default"}, {"id": "v47", "data": {"size": "l", "text": "Data", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "a7L", "data": {"size": "l", "text": "Basic cohorts", "showInTOC": true}, "type": "title", "namespace": "default"}, {"id": "Oj3", "data": {"size": "l", "text": "Retention and cohort size at one chart", "showInTOC": true}, "type": "title", "namespace": "default"}], "title": "Cohorts", "layout": [{"h": 19, "i": "bdQ", "w": 20, "x": 16, "y": 5}, {"h": 25, "i": "9Kn", "w": 24, "x": 0, "y": 30}, {"h": 18, "i": "1kE", "w": 24, "x": 0, "y": 50}, {"h": 27, "i": "W15", "w": 21, "x": 15, "y": 71}, {"h": 19, "i": "k76", "w": 16, "x": 0, "y": 5}, {"h": 3, "i": "EL4", "w": 22, "x": 0, "y": 27}, {"h": 4, "i": "e1J", "w": 24, "x": 0, "y": 46}, {"h": 17, "i": "dlQ", "w": 15, "x": 0, "y": 71}, {"h": 3, "i": "3jP", "w": 36, "x": 0, "y": 0}, {"h": 2, "i": "v47", "w": 36, "x": 0, "y": 3}, {"h": 3, "i": "a7L", "w": 36, "x": 0, "y": 24}, {"h": 3, "i": "Oj3", "w": 36, "x": 0, "y": 68}], "aliases": {}, "connections": []}], "counter": 720, "settings": {"expandTOC": false, "globalParams": {}, "silentLoading": false, "autoupdateInterval": null, "dependentSelectors": true, "maxConcurrentRequests": null}, "description": "This is an example dashboard for [DataLens](https://datalens.tech). You can find detailed feature descriptions on the tabs of the dashboard.", "schemeVersion": 7}', '{"is_release": true}', 'uid:systemId', '2023-11-24 13:49:16.274954+00', 'uid:systemId', '2023-11-24 13:49:16.274954+00', 1560950133770683411, 1507164768509628187, '{"05xu0bafozgep": "05xu0bafozgep", "05xu0e1so1o6p": "05xu0e1so1o6p", "16yxd7gojiacq":